insert tblsetlist (showid, linenr, settext) values (261,5,"Benefit for the rainforests: Cultural Survival, Greenpeace & Rainforest Action Network - Bruce Hornsby & The Range opened - FM broadcast WNEW-New York, WMMR-Philadelphia - 'West L. A.' & 'Rooster' with Mick Taylor - 'Chinese Bones' & 'Neighborhood Girls' with Suzanne Vega on acoustic guitar and vocals - 'Every Time?' and 'What's Going On' with Daryl Hall: guitar, lead vocals; John Oates: guitar; Tom 'T-Bone' Wolk: acoustic guitar, then accordion, then bass; Mark Rivera: saxophone; without Phil - 'River Drumz' with Baba Olatunji & Michael Hinton - Olatunji stayed for the rest of the set - 'NFA' with Bruce Hornsby on accordion - Both encores with Hall: vocals & Oates: guitar & vocals; Jack Casady: bass; Bruce Hornsby: vocals & electric piano, then accordion; without Phil - 'Heaven's Door' also with Suzanne Vega - only 'Chinese Bones' - only 'Every Time You Go Away' - only 'Neighborhood Girls' - only 'What's Going On'");
